module.exports = async d => {
    const code = d.command.code 
    
    const r = code.split("$hasEmbeds[").length - 1
    
    const inside = code.split("$hasEmbeds[")[r].split("]")[0]
    
    const [channelID, messageID] = inside.split(";")
    
    const channel = d.client.channels.cache.get(channelID)
    
    if (!channel) return d.error(`❌ Invalid channel ID in \`$clearReactions[${inside}]\``)
        
    const msg = await channel.messages.fetch(messageID).catch(err => null)
        
    if (!msg) return d.error(`❌ Invalid message ID in \`$clearReactions[${inside}]\``)
         
    return {
        code: code.replaceLast(`$hasEmbeds[${inside}]`, msg.embeds[0] ? true : false)
    }
}


 